Example_3:
input: [0, 5, 0, 0, 5, 0, 0, 0, 0]
output: [0, 5, 5, 5, 5, 0, 0, 0, 0]

Test case:
input: [0, 0, 0, 7, 0, 0, 0, 7, 0]

###########################################################
Sample Outputs:
output: [0, 0, 0, 7, 7, 7, 7, 7, 0]
*/

public class Solution {
    public int[] solution(int []arr) {
        int count = 0;
        for (int i=0; i<arr.length-1; i++) {
            if (arr[i] == arr[i+1]) {
                continue;
            } else {
                arr[count++] = arr[i];
            }
        }
        arr[count++] = arr[arr.length - 1];

        return Arrays.copyOfRange(arr, 0, count);
    }
}
